import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink, Navigate } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { useAuth } from './contexts/AuthContext';
import PrivateRoute from './components/PrivateRoute';

// Import authentication components
import Login from './components/Login';
import Signup from './components/Signup';

// Import existing components
import ExpenseList from './components/ExpenseList';
import ExpenseForm from './components/ExpenseForm';
import Dashboard from './components/Dashboard';

import './App.css';

// Navbar Component with User Info
const Navbar = () => {
  const { currentUser, logout } = useAuth();
  const [isScrolled, setIsScrolled] = useState(false);

  // Navigation links
  const navLinks = [
    { to: '/', label: '🏠 Dashboard', icon: '' },
    { to: '/expenses', label: '💸 Expenses', icon: '' },
    { to: '/add-expense', label: '➕ Add Expense', icon: '' }
  ];

  // Scroll effect for navbar
  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleLogout = async () => {
    try {
      await logout();
    } catch (error) {
      console.error('Logout failed', error);
    }
  };

  return (
    <nav className={`navbar ${isScrolled ? 'navbar-scrolled' : ''}`}>
      <div className="navbar-content">
        <div className="navbar-logo glow-effect">
          💰 AI Expense Tracker
        </div>
        <div className="navbar-links">
          {navLinks.map((link) => (
            <NavLink 
              key={link.to}
              to={link.to} 
              className={({ isActive }) => 
                `nav-link ${isActive ? 'active' : ''} glow-effect`
              }
            >
              {link.icon} {link.label}
            </NavLink>
          ))}
        </div>
        {currentUser && (
          <div className="user-info">
            <span className="user-email">
              {currentUser.email} {currentUser.providerData[0].providerId === 'google.com' && (
                <img src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg" alt="Google logo" className="google-icon" />
              )}
            </span>
            <button 
              onClick={handleLogout} 
              className="logout-btn"
            >
              Logout
            </button>
          </div>
        )}
      </div>
    </nav>
  );
};

function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
          {/* Dynamic Background Particles */}
          <div className="background-particle"></div>
          <div className="background-particle"></div>
          <div className="background-particle"></div>

          {/* Enhanced Navigation Bar */}
          <Navbar />

          {/* Main Content Area */}
          <div className="main-content">
            <Routes>
              {/* Public Routes */}
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<Signup />} />

              {/* Protected Routes */}
              <Route 
                path="/" 
                element={
                  <PrivateRoute>
                    <Dashboard />
                  </PrivateRoute>
                } 
              />
              <Route 
                path="/expenses" 
                element={
                  <PrivateRoute>
                    <ExpenseList />
                  </PrivateRoute>
                } 
              />
              <Route 
                path="/add-expense" 
                element={
                  <PrivateRoute>
                    <ExpenseForm />
                  </PrivateRoute>
                } 
              />

              {/* Redirect */}
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </div>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
